import { ItemContext } from "../App";
import React, { useContext } from "react";

const TopNav = () => {
  const { count, setCount } = useContext(ItemContext);
  return (
    <>
       <section id="heading">
            <div>
            <i class="uil uil-bars">&emsp;</i><i class="uil uil-search"></i><input class="quickfind" type="text" placeholder="Quick Find" style="font: Roboto"/>
            </div>
            <div class="right-heading"><i class="uil uil-check-circle"></i>{count}</div> 
        </section>
    </>
  );
};

export default TopNav;
